
describe("Test basic artPad local functions", function() {
    it("sets the local brush size", function() {
      artPad.localSetBrushSize(10);
      expect(artPad.localUser.brushSize).toBe(10);
      artPad.localSetBrushSize(23.2);
      expect(artPad.localUser.brushSize).toBe(23.2);
    });
    it("sets the local brush color", function() {
        artPad.localSetBrushColor("#000000");
        expect(artPad.localUser.brushColor).toBe("#000000");
        artPad.localSetBrushColor("#dddddd");
        expect(artPad.localUser.brushColor).toBe("#dddddd");    
    });
    it("sets the local brush alpha", function() {
        artPad.localSetBrushAlpha(1);
        expect(artPad.localUser.brushAlpha).toBe(1);
        artPad.localSetBrushAlpha(0.3);
        expect(artPad.localUser.brushAlpha).toBe(0.3);    
    });
});

describe("Test user functions", function() {
    user2 = artPad.addUser("user2");
    user3 = artPad.addUser("user3");
    localu = artPad.localAddUser("local");
    it("adds new users", function() {
      expect(artPad.fetchUser("user2")).toBe(user2);
      expect(artPad.fetchUser("user3")).toBe(user3);
      expect(artPad.fetchUser("user3")).not.toBe(undefined);
    });
    it("verifies users contain empty input", function() {
      expect(JSON.stringify(user2.inputSequence)).toBe('[]');
      expect(JSON.stringify(user3.inputSequence)).toBe('[]'); 
    });
    
    it("sets a user's brush brush color", function() {
        artPad.setBrushColor("user3", "#ab7d9f");
        expect(user3.brushColor).toBe("#ab7d9f");
        expect(artPad.getBrushColor("user3")).toBe("#ab7d9f");
    });
    it("sets a user's brush brush size", function() {
        artPad.setBrushSize("user2", 3);
        expect(user2.brushSize).toBe(3);
        expect(artPad.getBrushSize("user2")).toBe(3);
    });
    
    it("sets a user's brush alpha", function() {
        artPad.setBrushAlpha(artPad.localUser.id, 0.1);
        expect(artPad.localUser.brushAlpha).toBe(0.1);
    });
    
});



